import Paper from "@material-ui/core/Paper";
import AccountCircleIcon from "@material-ui/icons/AccountCircle";

export default function Form() {
  return (
    <section className="Form">
      <Paper className="Form-Paper">
        <AccountCircleIcon />
      </Paper>

      <style jsx>
        {`
          Form-Paper {
            height: 100px;
          }
        `}
      </style>
    </section>
  );
}
